  const [posts, setPosts] = useState([
    {id: 1, title: 'JavaScript', body: 'JS Description'},
    {id: 2, title: 'Python', body: 'Python Description'},
    {id: 3, title: '.NET', body: '.NET Description'}
  ])

  return (
    <div className="App">
      <PostList posts={posts}/>
    </div>
  );
}

export default App;
